import PropTypes from 'prop-types'

const Navbar1 = ({title}) => {
  return (
    <header><h1>{title}</h1>
    <button className='btn'>Add</button>
    </header>
  )
}

Navbar1.propTypes = {
    title: PropTypes.string.isRequired,}


Navbar1.defaultProps = { title:'Task Tracker'}
export default Navbar1
